  \"2015-02-04T19:06:52.215183\",\n\t\"name\": \"staten-island-ferry-schedule-gtfs-312cd\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Staten Island Ferry carries over 21
  million passengers a year between St. George Terminal in Staten Island and Whitehall
  Terminal in Manhattan. On a typical workday, the ferry makes 109 trips. This General
  Transit Feed Specification (GTFS) (https://developers.google.com/transit/gtfs/)
  dataset includes information about the ferry terminal, and all scheduled weekday,
  weekend and holiday trips. The ferry's schedule may be adjusted due to heavy weather
  or low visibility. Adjustments are announced by email and in DOT's Twitter stream.\",\n\t\"license_title\":
